import React, { Component } from "react";

class UserDetail extends Component {
  render() {
    return (
      <div>
        <li>Date of Birth: {this.props.userData.dob}</li>
        <li>City: {this.props.userData.city}</li>
      </div>
    );
  }
}

export default UserDetail;
